import Form from 'react-bootstrap/Form';
import USD from '../../imgs/images.png'
import EUR from '../../imgs/eur.png'
import UAH from '../../imgs/uah.png'

import 'select.sass'

function Select() {
    return (
        <Form.Select aria-label="Default select example">
            <option>Currency</option>
            <option value="1"><img src={USD} ref={'usd'} className={'flag'}/> USD</option>
            <option value="2"><img src={EUR} ref={'eur'} className={'flag'}/> EUR</option>
            <option value="3"><img src={UAH} ref={'uah'} className={'flag'}/> UAH</option>
        </Form.Select>
    );
}

export default Select;
